sys_variable_value.value:
(function execute(inputs, outputs) {

var newApp = new GlideRecord('sys_app');
var newAppName = inputs.newappname;

newApp.initialize();

newApp.name= newAppName;
newApp.scope = 'x_snc_' + newAppName.toLowerCase().replace(/[^a-z]/g, "_");
var newAppID = newApp.insert();

var newTable = new GlideRecord('sys_db_object');
var newTableName = inputs.newappname;

newTable.Label = newAppName;
newTable.Name = 'x_snc_' + newAppName.toLowerCase().replace(/[^a-z]/g, "_");

//newTable.super_class = 'sn_gsm_service_request_case'; d0894ebd471d42104f6574fc416d4372
newTable.super_class = 'd0894ebd471d42104f6574fc416d4372';
newTable.sys_scope = newAppID;
var newTableID = newTable.insert();

outputs.result = newAppID + " Return from table create: " + newTableID;

})(inputs, outputs);

